import React from 'react';
import Project from '../Project/Project';
// 
import prj1 from '../../images/headshotDB.JPG';
import prj2 from '../../images/headshotDB.JPG';
import prj3 from '../../images/headshotDB.JPG';
import prj4 from '../../images/headshotDB.JPG';
import './Portfolio.css'; // import the CSS file

const Portfolio = () => {
  // Actual projects data
  // Add my prtojects here:
  const projects = [
    { title: 'Project 1: LitList', imageUrl: prj1, deployedUrl: 'https://samanthaahn.github.io/fiesta-event/', repoUrl: 'https://github.com/samanthaahn/fiesta-event'},
    { title: 'Project 2: Thank You For Being a Friend', imageUrl: prj2, deployedUrl: 'https://lit-ocean-94336.herokuapp.com/loginLinks', repoUrl: 'https://github.com/jjjgm/gg-get-icecream.git' },
    { title: 'Project 3: Habit Tracker (Coming Soon)', imageUrl: prj3, deployedUrl: 'www.google.com', repoUrl: 'https://github.com/samanthaahn/magic-list' },
    { title: 'Project 4', imageUrl: prj4, deployedUrl: 'https://github.com/harold-fv/project2-foodcritics', repoUrl: 'https://github.com/harold-fv/project2-foodcritics' },
    // ...
  ];

  return (
    <div className="mainproject">
      <section className="portfolio">
        <h2>Portfolio</h2>
        <div className="projects-container">
          {projects.map((project, index) => (
            <Project key={index} {...project} />
          ))}
        </div>
      </section>
    </div>
  );
};

export default Portfolio;
